import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <>
      <div className="footer">
        <p>
          상호 : Your Sweet Home ㅣ 주소 : 서울특별시 강남구 테헤란로 4길 38-5 ㅣ 문의 : 02)
          890-3456
        </p>
      </div>
    </>
  );
};

export default Footer;
